        <div class='scren_2_text1'>
        Проводим как комплексную, так и частичную экспертизу проектно-сметной документации – отдельных разделов и результатов инженерных изысканий. Заключение экспертизы подтверждает надежность и безопасность возводимого сооружения.  </div>
